import React from 'react';
import ReactDOM from 'react-dom';
import Tilt from 'react-parallax-tilt';
import './Logo.css';

const Logo = () => {
	return (
		<div className='ma4 mt0'>
			<Tilt className="Tilt br2 shadow-2" >
      			<div style={{ height: '150px', width: '40px'}}>
        			
      			</div>
    		</Tilt>
		</div>
	);
}

export default Logo;
